{color:#333333}Sistēmai jānodrošina panelis, kurā tiek attēlotas pieteikumi, kas izkārtoti statusu kolonnās. Attēlošanai jāizmanto _Kanban_ _Board_ iestatījuumu un pieteikumu dati.{color}

{color:#333333}Tukšās Paneļa kolonnas jārāda šaurākas nekā pilnās.{color}

{color:#333333}Ja _Kanban Board_ iestatījumu un pieteikumu dati kopš iepriekšējās reizes nav mainījušies, panelis nav jāpārzīmē.{color}

{color:#333333}Ja _Kanban_ _Board_ iestatījumu un pieteikumu datu nolasīšana beidzas ar kļūdu, jāizmanto pēdējie veiksmīgi nolasītie iestatījumi un jāattēlo pēdējie veiksmīgi nolasītie dati. Šadā gadījumā jābūt redzamai pazīmei, ka attēlojamie dati ir no keša.{color}

{color:#333333}Sistēmai jāattēlo pieteikumā šāda informācija:{color}
 * {color:#333333}nosaukums (pilns), kas darbotos kā hipersaite uz pieteikuma detaļu rediģēšanas  saskarni;{color}
 * {color:#333333}identifikators;{color}
 * {color:#333333}adresāts;{color}
 * {color:#333333}prioritāte (krāsas veidā);{color}

Pieņemšanas nosacījumi:
 * Paneļu saraksts ir daļa no Administratora rīkiem, kurā tiek uzturēti attēlojamo Paneļu iestatījumi;
 * Iestatījumi, kas jāuztur
 ** vai attēlot attiecīgo Paneli slaidrādē;
 ** Paneļa attēlošanas laiks sekundēs, pēc kura beigām tiek attēlots nākošais Panelis;
 ** Paneļa pārzīmēšanas laiks sekundēs, pēc kura beigām tiek attēlots tas pats Panelis.

Pieņemšanas nosacījumi:
 * administratora pieslēgšanās iespējama izmantojot aktīvā direktorija lietotāja pierakstīšanās datus;
 * aktīvajā direktorijā jābūt noteiktai Sistēmas administratoru grupai;
 * Sistēmas web.config datnē jābūt iestatītai norādei uz aktīvā direktorija Sistēmas administratoru grupu;
 * priekšnoteikumi:
 ** lietotājam iekš _Kanban Board_ iestatījumiem jābūt piešķirtām skatīšanās tiesībām.
